GKILL` due to OOM.; I also tried with `true` though. Here is my simple OOM tester WDL. I tested it with PAPIv2 beta based on Life Sciences API. ```wdl; version 1.0. workflow mem_retry {; call fail_oom; }. task fail_oom {; command {; set -e; # This one-liner triggers OOM and hence 137 (SIGKILL); # https://askubuntu.com/a/823798; tail /dev/zero # <====== This WDL works fine without this line; }; runtime {; cpu: 1; memory: "2 GB"; docker: "ubuntu:latest"; continueOnReturnCode: [0, 137]; }; }; ```. Google backend (PAPI2 beta) in `backend.conf`, ; ```; config {; memory-retry {; error-keys = ["OutOfMemoryError", "Killed"]; multiplier = 1.5; }; }; ```. STDERR of task:; ```; $ gsutil cat gs://encode-pipeline-test-runs/caper_out_10/mem_retry/87492280-9828-4afa-b53e-bec675103c42/call-fail_oom/stderr; /cromwell_root/script: line 28: 17 Killed tail /dev/zero; ```. RC of task. It's weird that this is not caught in `metadata.json`.; ```; $ gsutil cat gs://encode-pipeline-test-runs/caper_out_10/mem_retry/87492280-9828-4afa-b53e-bec675103c42/call-fail_oom/rc; 137; ```. `memory_retry_rc`: So Cromwell found that it's failed due to OOM.; ```; $ gsutil cat gs://encode-pipeline-test-runs/caper_out_10/mem_retry/87492280-9828-4afa-b53e-bec675103c42/call-fail_oom/memory_retry_rc; 0; ```. `metadata.json`; ```; {; "workflowName": "mem_retry",; "workflowProcessingEvents": [; {; "timestamp": "2020-08-29T00:00:38.724Z",; "cromwellVersion": "53",; "cromwellId": "cromid-0a29b92",; "description": "PickedUp"; },; {; "description": "Finished",; "cromwellId": "cromid-0a29b92",; "timestamp": "2020-08-29T00:04:06.072Z",; "cromwellVersion": "53"; }; ],; "metadataSource": "Unarchived",; "actualWorkflowLanguageVersion": "1.0",; "submittedFiles": {; "workflow": "version 1.0

workflow mem_retry {
 call fail_oom 
}

task fail_oom {
 command {
 set -e
 # This one-liner triggers 137 (SIGKILL due to OOM)
 # https://askubuntu.com/a/823798
 tail /dev/zero
 }
 runtime {
 cpu: 1
 memory: "2 GB"
 d

GOTC was running the test for staging PAPI (Pipelines API). This test is launching 50 Single Sample workflows at once and 4 of our workflows failed with this error.; ```; "message": "429 Too Many Requests
{
 "code" : 429,
 "errors" : [ {
 "domain" : "global",
 "message" : "Insufficient tokens for quota group and limit 'defaultUSER-100s' of service 'staging-genomics.sandbox.googleapis.com', using the limit by ID '628662467800@1088569555438'.",
 "reason" : "rateLimitExceeded"
 } ],
 "message" : "Insufficient tokens for quota group and limit 'defaultUSER-100s' of service 'staging-genomics.sandbox.googleapis.com', using the limit by ID '628662467800@1088569555438'.",
 "status" : "RESOURCE_EXHAUSTED"
}"; ```. All 4 of the jobs that failed were non-premptible whereas there are preemptible jobs that ran into this error and just went from attempt 1 to attempt 2 or w/e. . I don't think we would want this error to count towards our attempt count and we definitely don't want it to fail non preemptible tasks. @kcibul for prioritization

