Still looking at a Centaur test for this but I thought I'd let the seafowl have at it. Metadata looks like:. ```; {; "workflowName": "three_step",; "submittedFiles": {; "workflow": "import "3step-tasks.wdl" as tasks
import "https://raw.githubusercontent.com/broadinstitute/centaur/591beaf8422af7c3faf51e437a91d94d13b76eba/src/main/resources/standardTestCases/aliased_subworkflows/subworkflow.wdl" as subworkflow


workflow three_step {
 call tasks.ps as ps
 call tasks.cgrep as cgrep {
 input: in_file = ps.procs
 }
 call tasks.wc as wc {
 input: in_file = ps.procs
 }
 output {
 cgrep.*
 wc.*
 }
}
",; "workflowType": "WDL",; "options": "{

}",; "inputs": "{"three_step.cgrep.pattern":"mcovarr"}",; "labels": "{}",; "imports": {; "https://raw.githubusercontent.com/broadinstitute/centaur/591beaf8422af7c3faf51e437a91d94d13b76eba/src/main/resources/standardTestCases/aliased_subworkflows/subworkflow.wdl": "task increment {
 Int i
 command {
 echo $(( ${i} + 1 ))
 }
 output {
 Int j = read_int(stdout())
 }
 runtime {
 docker: "ubuntu:latest"
 }
}

workflow subwf {
 Array[Int] is
 scatter (i in is) {
 call increment { input: i = i }
 }
 output {
 Array[Int] js = increment.j
 }
}
",; "3step-tasks.wdl": "task ps {
 command {
 ps
 }
 output {
 File procs = stdout()
 }
 runtime {
 docker: "ubuntu:latest"
 }
}

task cgrep {
 String pattern
 File in_file
 command {
 grep '${pattern}' ${in_file} | wc -l
 }
 output {
 Int count = read_int(stdout())
 }
 runtime {
 docker: "ubuntu:latest"
 }
}

task wc {
 File in_file
 command {
 cat ${in_file} | wc -l
 }
 output {
 Int count = read_int(stdout())
 }
 runtime {
 docker: "ubuntu:latest"
 }
}

